import React from "react";
// import "./checkout.scss";

const CheckoutPage = () => {
  return (
    <div
      className="checkout-page"
      style={{ width: "55%", border: "solid blue" }}
    >
      <div
        className="checkout-header"
        style={{ display: "flex", margin: "30px auto", width: "100%" }}
      >
        <div className="header-block">
          <span style={{ width: "20%" }}>Product</span>
        </div>
        <div className="header-block">
          <span style={{ width: "20%" }}>Description</span>
        </div>
        <div className="header-block">
          <span style={{ width: "20%" }}>Quantity</span>
        </div>
        <div className="header-block">
          <span style={{ width: "20%" }}>Price</span>
        </div>
        <div className="header-block">
          <span style={{ width: "20%" }}>Remove</span>
        </div>
      </div>
    </div>
  );
};

export default CheckoutPage;
